//SPDX-License-Identifier: BUSL-1.1
pragma solidity ^0.8.0;

import "./4_SegaP.sol";

contract SegaFactP {

    address[] public SegaList;
    event SegaCreated(address indexed vault, address indexed sega);

    function createSega(address _vault, address _trader) public returns (address){
        SEGA sega = new SEGA(_vault , _trader);
        SegaList.push(address(sega));
        emit SegaCreated(address(_vault), address(sega));
        return address(sega);
    } 

    //Overloading createSega with index variable which can be used later for new sega structures
    function createSega(address _vault, address _trader, uint256 index) external returns (address){
        address newSega = createSega(_vault, _trader);
        return newSega;
    }

    function getSegaList() public view returns (address[] memory) {
        return SegaList;
    }
}
